import styles from './CourseDescribe.module.css';

function CoursDescribe() {
    return(
        <div className={styles.container}>
            <h2 className={styles.header}>Poznaj podstwy<br />JavaScript</h2>
            <p>Nasz kurs pozwoli Ci w pełni zrozumieć i opanować najpopularniejszy język programowania na świecie oraz poznasz jego praktyczne zastosowania w pracy JavaScript developera</p>
        </div>
    )
}

export default CoursDescribe;
